import React, { useEffect, useRef } from 'react';
import Svg, { Line, Defs, Pattern, Rect } from 'react-native-svg';
import { View, StyleSheet, Animated, Easing } from 'react-native';

const GridBackground = () => {
  const fadeAnim = useRef(new Animated.Value(0.5)).current;
  const colorAnim = useRef(new Animated.Value(0)).current;
  const translateX1 = useRef(new Animated.Value(0)).current;
  const translateX2 = useRef(new Animated.Value(0)).current;
  const translateY1 = useRef(new Animated.Value(0)).current;
  const translateY2 = useRef(new Animated.Value(0)).current;

  useEffect(() => {
    // Breathing effect
    Animated.loop(
      Animated.sequence([
        Animated.timing(fadeAnim, {
          toValue: 0.8,
          duration: 2000,
          easing: Easing.inOut(Easing.sine),
          useNativeDriver: true,
        }),
        Animated.timing(fadeAnim, {
          toValue: 0.5,
          duration: 2000,
          easing: Easing.inOut(Easing.sine),
          useNativeDriver: true,
        })
      ])
    ).start();

    // Color vibration
    Animated.loop(
      Animated.sequence([
        Animated.timing(colorAnim, {
          toValue: 1,
          duration: 1500,
          easing: Easing.inOut(Easing.sine),
          useNativeDriver: false,
        }),
        Animated.timing(colorAnim, {
          toValue: 0,
          duration: 1500,
          easing: Easing.inOut(Easing.sine),
          useNativeDriver: false,
        })
      ])
    ).start();

    // Continuous horizontal movements - faster
    Animated.loop(
      Animated.timing(translateX1, {
        toValue: -200,
        duration: 15000,
        easing: Easing.linear,
        useNativeDriver: true,
      })
    ).start();

    Animated.loop(
      Animated.timing(translateX2, {
        toValue: 200,
        duration: 18000,
        easing: Easing.linear,
        useNativeDriver: true,
      })
    ).start();

    // Continuous vertical movements - faster
    Animated.loop(
      Animated.timing(translateY1, {
        toValue: -200,
        duration: 20000,
        easing: Easing.linear,
        useNativeDriver: true,
      })
    ).start();

    Animated.loop(
      Animated.timing(translateY2, {
        toValue: 200,
        duration: 25000,
        easing: Easing.linear,
        useNativeDriver: true,
      })
    ).start();
  }, []);

  // Color interpolation for vibration
  const baseColor = colorAnim.interpolate({
    inputRange: [0, 1],
    outputRange: ['rgba(244, 228, 9, 0.4)', 'rgba(244, 228, 9, 0.6)']
  });

  const midColor = colorAnim.interpolate({
    inputRange: [0, 1],
    outputRange: ['rgba(184, 134, 11, 0.5)', 'rgba(184, 134, 11, 0.7)']
  });

  const topColor = colorAnim.interpolate({
    inputRange: [0, 1],
    outputRange: ['rgba(218, 165, 32, 0.6)', 'rgba(218, 165, 32, 0.8)']
  });

  return (
    <View style={styles.container}>
      {/* Base layer */}
      <Animated.View 
        style={[
          styles.overlay, 
          { 
            opacity: fadeAnim,
            transform: [
              { translateX: translateX1 },
              { translateY: translateY1 }
            ]
          }
        ]}
      >
        <Svg height="200%" width="200%" style={styles.grid}>
          <Defs>
            <Pattern 
              id="grid3" 
              width="200" 
              height="200" 
              patternUnits="userSpaceOnUse"
              patternTransform="rotate(15)"
            >
              <Animated.Line
                x1="0"
                y1="200"
                x2="200"
                y2="200"
                stroke={baseColor}
                strokeWidth="1.2"
              />
              <Animated.Line
                x1="200"
                y1="0"
                x2="200"
                y2="200"
                stroke={baseColor}
                strokeWidth="1.2"
              />
            </Pattern>
          </Defs>
          <Rect width="200%" height="200%" fill="url(#grid3)" x="-50%" y="-50%" />
        </Svg>
      </Animated.View>

      {/* Middle layer */}
      <Animated.View 
        style={[
          styles.overlay, 
          { 
            opacity: fadeAnim,
            transform: [
              { translateX: translateX2 },
              { translateY: translateY2 }
            ]
          }
        ]}
      >
        <Svg height="200%" width="200%" style={styles.grid}>
          <Defs>
            <Pattern 
              id="grid2" 
              width="100" 
              height="100" 
              patternUnits="userSpaceOnUse"
              patternTransform="rotate(-15)"
            >
              <Animated.Line
                x1="0"
                y1="100"
                x2="100"
                y2="100"
                stroke={midColor}
                strokeWidth="0.8"
              />
              <Animated.Line
                x1="100"
                y1="0"
                x2="100"
                y2="100"
                stroke={midColor}
                strokeWidth="0.8"
              />
            </Pattern>
          </Defs>
          <Rect width="200%" height="200%" fill="url(#grid2)" x="-50%" y="-50%" />
        </Svg>
      </Animated.View>

      {/* Top layer */}
      <Animated.View 
        style={[
          styles.overlay, 
          { 
            opacity: fadeAnim,
            transform: [
              { translateX: Animated.multiply(translateX1, 0.5) },
              { translateY: Animated.multiply(translateY2, 0.5) }
            ]
          }
        ]}
      >
        <Svg height="200%" width="200%" style={styles.grid}>
          <Defs>
            <Pattern 
              id="grid1" 
              width="50" 
              height="50" 
              patternUnits="userSpaceOnUse"
              patternTransform="rotate(30)"
            >
              <Animated.Line
                x1="0"
                y1="50"
                x2="50"
                y2="50"
                stroke={topColor}
                strokeWidth="0.5"
              />
              <Animated.Line
                x1="50"
                y1="0"
                x2="50"
                y2="50"
                stroke={topColor}
                strokeWidth="0.5"
              />
            </Pattern>
          </Defs>
          <Rect width="200%" height="200%" fill="url(#grid1)" x="-50%" y="-50%" />
        </Svg>
      </Animated.View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    zIndex: -1,
    overflow: 'hidden',
  },
  overlay: {
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
  },
  grid: {
    position: 'absolute',
    top: 0,
    left: 0,
  },
});

export default GridBackground;
